import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {title: 'Car Insurance', amount: 250.00, date: new Date("2023", "1", "6")},
    {title: 'Car Insurance', amount: 250.00, date: new Date("2023", "1", "6")},
    {title: 'Car Insurance', amount: 250.00, date: new Date("2023", "1", "6")},
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
